    public class WorkFlowFormListRepository : Repository<WorkFlowFormList>, IWorkFlowFormListRepository
    {
        public WorkFlowFormListRepository(BpmsDbContext context) : base(context)
        {
        }
        public BpmsDbContext DbContext => Context;

        public void CheckForDelete(Guid id)
        {

            var forms = DbContext.WorkFlowForms;
            foreach (var form in forms)
            {
                var encoding = new UnicodeEncoding();
                var jsonFile = JObject.Parse(encoding.GetString(form.Content));

                var fileds = jsonFile["fields"];
                foreach (var filed in fileds)
                {
                    var fli = filed.First.ToObject<JObject>();

                    var type = (string)fli["meta"]["id"];
                    if (type != "list") continue;
                    var value = (string)fli["attrs"]["value"];
                    if (value == id.ToString())
                    {
                        throw new ArgumentException("امکان حذف این رکورد به دلیل استفاده در فرم ها وجود ندارد.");
                    }
                }
            }
        }

        public WorkFlowFormListViewModel GetListElementById(Guid id)
        {
            var list = DbContext.WorkFlowFormList.Find(id);
            var encoding = new UnicodeEncoding();
            var json = encoding.GetString(list.Content);

            return new WorkFlowFormListViewModel()
            {
                Title = list.Title,
                Id = list.Id,
                JsonContent = HelperBs.EncodeUri(json),
            };
        }

